import React from "react";
import { Buscador } from "./buscador";

import FooterLayout from "./Footer";
import Propiedades from "./propiedades";




const  PaginaDeBusqueda=()=>
{
    return(
        <div className="todo">
            <Buscador></Buscador>
            <Propiedades/>
            <FooterLayout></FooterLayout>
        </div>

    )

}

export default PaginaDeBusqueda;
